    "idiomes": {
      "CAT": {
        "titol": "Llum de tots els qui viuen",
        "audio": null,
        "cansoners": [
          {
            "nom": "Vermell",
            "numero": 122,
            "estat": null
          }
        ],
        "lletra": [
          {
            "tipus": "estrofa",
            "visibleAlsMusics": true,
            "paragraf": [
              {
                "text": "Llum de tots",
                "acordsASobre": [
                  { "nota": "RE", "pos": 0 },
                  { "nota": "LA", "pos": 8 }
                ]
              },
              {
                "text": "Els qui viuen en la foscor.",
                "acordsASobre": [
                  { "nota": "SOL", "pos": 8 }
                ]
              },
              {
                "text": "Obre els meus ulls i et veuré.",
                "acordsASobre": [
                  { "nota": "RE", "pos": 0 },
                  { "nota": "LA", "pos": 14 },
                  { "nota": "SOL", "pos": 27 }
                ]
              },
              {
                "text": "Ple és el meu cor de la teva bellesa",
                "acordsASobre": [
                  { "nota": "RE", "pos": 0 },
                  { "nota": "LA", "pos": 14 },
                  { "nota": "SOL", "pos": 23 }
                ]
              },
              {
                "text": "Tan sols desitjo estar amb Tu.",
                "acordsASobre": [
                  { "nota": "RE", "pos": 0 },
                  { "nota": "LA", "pos": 12 },
                  { "nota": "SOL", "pos": 27 }
                ]
              }
            ]
          },
          {
            "tipus": "tornada",
            "visibleAlsMusics": true,
            "paragraf": [
              {
                "text": "Vinc aquí a lloar-te",
                "acordsASobre": [
                  { "nota": "RE", "pos": 14 }
                ]
              },
              {
                "text": "Vinc per adorar-te",
                "acordsASobre": [
                  { "nota": "LA", "pos": 13 }
                ]
              },
              {
                "text": "Vinc a dir-te que Tu ets el meu Déu.",
                "acordsASobre": [
                  { "nota": "RE", "pos": 15 },
                  { "nota": "SOL", "pos": 32 }
                ]
              },
              {
                "text": "En Tu tot és amor,",
                "acordsASobre": [
                  { "nota": "RE", "pos": 15 }
                ]
              },
              {
                "text": "Digne de lloança",
                "acordsASobre": [
                  { "nota": "LA", "pos": 11 }
                ]
              },
              {
                "text": "Ets tot el que jo puc desitjar.",
                "acordsASobre": [
                  { "nota": "RE", "pos": 15 },
                  { "nota": "SOL", "pos": 28 }
                ]
              }
            ]
          },
          {
            "tipus": "estrofa",
            "visibleAlsMusics": true,
            "paragraf": [
              {"text": "Ets exalçat, Rei de reis, per sempre"},
              {"text": "Glorificat dalt del cel."},
              {"text": "Vas venir al món per ser un de nosaltres"},
              {"text": "Tot ho vas fer per amor."}
            ]
          },
          {
            "tipus": "tornada",
            "visibleAlsMusics": false,
            "paragraf": [
              {"text": "Vinc aquí a lloar-te"},
              {"text": "Vinc per adorar-te"},
              {"text": "Vinc a dir-te que Tu ets el meu Déu."},
              {"text": "En Tu tot és amor,"},
              {"text": "Digne de lloança"},
              {"text": "Ets tot el que jo puc desitjar."}
            ]
          },
          {
            "tipus": "estrofa",
            "visibleAlsMusics": true,
            "paragraf": [
              {
                "text": "Jo mai sabré quant vas patir",
                "acordsASobre": [
                  { "nota": "LA", "pos": 0 },
                  { "nota": "RE", "pos": 4 },
                  { "nota": "SOL", "pos": 13 }
                ]
              },
              {
                "text": "Pel meu pecat, vas ser clavat. ",
                "acordsASobre": [
                  { "nota": "LA", "pos": 2 },
                  { "nota": "RE", "pos": 8 },
                  { "nota": "SOL", "pos": 16 }
                ]
              }
            ],
            "vegades": 3
          },
          {
            "tipus": "tornada",
            "visibleAlsMusics": false,
            "paragraf": [
              {"text": "Vinc aquí a lloar-te"},
              {"text": "Vinc per adorar-te"},
              {"text": "Vinc a dir-te que Tu ets el meu Déu."},
              {"text": "En Tu tot és amor,"},
              {"text": "Digne de lloança"},
              {"text": "Ets tot el que jo puc desitjar."}
            ]
          }
        ]
      }
    }
